import React from "react";
import {
  MDBCol,
  MDBContainer,
  MDBRow,
  MDBBtn,
  MDBBadge,
  MDBCarousel,
  MDBCarouselCaption,
  MDBCarouselInner,
  MDBCarouselItem,
  Testimonial,
  MDBAvatar,
  MDBStepper,
  MDBStep,
  MDBView,
  MDBProgress,
  MDBMask,
  MDBCardBody,
  MDBCardTitle,
  MDBIcon,
  MDBCard,
  MDBCardImage,
} from "mdbreact";

const AboutContent = (props) => {
  return (
    <div className="container-fluid About-content">
      <div className="row1">
        <MDBCard className="row1-image">
          <MDBCardBody className="text-center card-text">
            <MDBCardImage className="img-fluid" src="images/picture2.png">
              {" "}
            </MDBCardImage>
          </MDBCardBody>
        </MDBCard>
      </div>
    </div>
  );
};

export default AboutContent;
